import React from "react";

export default function Header() {
  return (
    <header className="site-header">
      <div className="topbar">
        <div className="logo">CLO-SET</div>
        <nav className="navlinks">
          <span>STORE</span>
          <span>GALLERY</span>
          <span>COMMUNITY</span>
        </nav>
      </div>

      <div className="hero">
        <h1>Share your ideas.<br/>Empower your design.</h1>
        <div style={{height: 16}} />
      </div>
    </header>
  );
}
